import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const PopularSearches = () => {
  // Group searches into columns
  const searches = [
    [
      "cleaning services dc",
      "san antonio maid service",
      "maid service los angeles",
      "maid service nyc",
      "chicago maids",
      "house cleaning service houston",
      "cleaning services las vegas",
      "maid service seattle",
      "cleaning service miami",
      "cleaning service la"
    ],
    [
      "houston move out cleaning",
      "chicago cleaning service",
      "san diego cleaning service",
      "boston cleaning service",
      "seattle cleaning service",
      "cleaning service",
      "philadelphia cleaning service",
      "pittsburgh cleaning service",
      "san jose cleaning service",
      "los angeles housekeeping"
    ],
    [
      "chicago apartment cleaning",
      "house cleaning service chicago",
      "las vegas maids",
      "seattle house cleaning service",
      "phoenix house cleaning service",
      "phoenix cleaning service",
      "tampa cleaning service",
      "dallas house cleaning",
      "house cleaning sacramento",
      "housekeeping"
    ]
  ];

  return (
    <section className="py-5 bg-white">
      <Container>
        <h2 className="mb-4 text-center">Popular Searches</h2>
        <Row>
          {searches.map((column, index) => (
            <Col md={4} key={index}>
              <ul className="list-unstyled">
                {column.map((search, i) => (
                  <li key={i} className="mb-2">
                    <a href="#" className="text-decoration-none text-dark">
                      {search}
                    </a>
                  </li>
                ))}
              </ul>
            </Col>
          ))}
        </Row>
      </Container>
    </section>
  );
};

export default PopularSearches;
